import {expect} from "chai";
import "reflect-metadata";
import { SoundService } from "./sound.service";

describe("SoundService", () => {
    let service: SoundService;

    beforeEach(() => { service = new SoundService(); });

    it("Should return the correct sound", () => {
        const rightSound: boolean = true;

        const result: string = service.sound(rightSound);

        // tslint:disable-next-line:max-line-length
        expect(result).to.equal("data:audio/mp3;base64,");

    });
    it("Should return the Incorrect sound", () => {
        const rightSound: boolean = false;

        const result: string = service.sound(rightSound);
        // tslint:disable-next-line:max-line-length
        expect(result).to.equal("data:audio/mp3;base64,");

    });
});
